import React from 'react';
import { Navbar, Nav, Form, FormControl, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '/NavBar'
const NavBar = () => {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand as={Link} to="/home">CRUD</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <div className="nav-link-box">
              <Nav.Link as={Link} to="/">Home</Nav.Link>
            </div>
            <div className="nav-link-box">
              <Nav.Link as={Link} to="/create">Add a User
                <svg xmlns="http://www.w3.org/2000/svg" width="26" height="20" fill="currentColor" className="bi bi-person-add" viewBox="0 0 16 16">
                  {/* SVG Path data */}
                </svg>
              </Nav.Link>
            </div>
            <div className="nav-link-box">
              <Nav.Link as={Link} to="/read">See all users</Nav.Link>
            </div>
          </Nav>
          <Form inline className="ml-auto">
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavBar;
